// Import necessary modules and objects
import {
  paginatingEndpoints // An array of paginating endpoint strings
} from "./generated/paginating-endpoints.js";
import { paginatingEndpoints as paginatingEndpoints2 } from "./generated/paginating-endpoints.js";

// Function to check if a given argument is a paginating endpoint
function isPaginatingEndpoint(arg) {
  // If the argument is a string
  if (typeof arg === "string") {
    // Check if the string is included in the paginatingEndpoints array
    return paginatingEndpoints.includes(arg);
  } else {
    // If the argument is not a string, return false
    return false;
  }
}

// Export the isPaginatingEndpoint function and the paginatingEndpoints2 array
export {
  isPaginatingEndpoint,
  paginatingEndpoints2 as paginatingEndpoints // Rename paginatingEndpoints2 to paginatingEndpoints for export
};
